import Header from "./components/Header";
import withDashboardContext from "./hoc/withDashboardContext";
import "./Ac"

const ActiveStudents = () => {
  return (
    <div>
      <Header />
      <div
        style={{
          background: "rgb(204,204,204,.5)",
          display: "flex",
          justifyContent: "space-around",
          height: "100vh",
        }}
      >
        <div>
          <button>Back</button>
          <span>
            <span>Home {">"}</span>
            <span> All Active Users</span>
          </span>
        </div>
        <div
          style={{
            background: "white",
            height: "fit-content",
            padding: "3.5rem 1rem 7rem 1.5rem",
            width: "70%",
            margin: "0 auto",
          }}
        >
          <span>All Active Users</span>
          <table>
            <tr>
              <th>Company</th>
              <th>Contact</th>
              <th>Country</th>
            </tr>
            <tr>
              <td>Test</td>
              <td>Test</td>
              <td>Test</td>
            </tr>
          </table>
        </div>
      </div>
    </div>
  );
};

export default withDashboardContext(ActiveStudents);
